    ["2003010"]=setmetatable({soundId=2003010,leaderId=2003001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Xialuo_Main_Talk4",soundText="时常出现在夏洛脑海之中的声音，与其说那是歌声，倒不如说是恸哭要更贴切一些，虽然夏洛很想立刻把这台出现故障的播放器关掉，但果然还是应该先搞清楚发出悲鸣的究竟是什么，探索未知才是旅行的真谛嘛！",soundOpen=1},mt),
    ["2003011"]=setmetatable({soundId=2003011,leaderId=2003001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Xialuo_Main_Online",soundText="虽然夏洛很欣赏导师沉迷工作的样子……但是持续劳动会让效率降低的哦？",soundOpen=6},mt),
    ["2003012"]=setmetatable({soundId=2003012,leaderId=2003001,sounType=1,soundName="摇晃",characterVoiceName="Vo_Xialuo_Main_Shake",soundText="头，头好晕。",soundOpen=5},mt),
    ["2003013"]=setmetatable({soundId=2003013,leaderId=2003001,sounType=1,soundName="闲趣",characterVoiceName="Vo_Xialuo_Main_Click_Continue",soundText="太快了！给夏洛一点时间反应啊？",soundOpen=1},mt),
    ["2003014"]=setmetatable({soundId=2003014,leaderId=2003001,sounType=1,soundName="伫立",characterVoiceName="Vo_Xialuo_Main_Idle1",soundText="这里的景色导师是不是也看入迷了呀？",soundOpen=1},mt),
    ["2003015"]=setmetatable({soundId=2003015,leaderId=2003001,sounType=1,soundName="索然",characterVoiceName="Vo_Xialuo_Main_Idle2",soundText="哼哼哼，哼哼哼哼哼。咦？好像在哪里听过这个旋律，唔，在哪里呢？",soundOpen=1},mt),
    ["2003016"]=setmetatable({soundId=2003016,leaderId=2003001,sounType=1,soundName="邀约",characterVoiceName="Vo_Xialuo_Main_Assistant",soundText="导师！夏洛来啦！有什么话想要和夏洛说么？尽管说吧！夏洛一定会做一位优秀的倾听者的！",soundOpen=1},mt),
    ["2003017"]=setmetatable({soundId=2003017,leaderId=2003001,sounType=1,soundName="就餐问候",characterVoiceName="Vo_Xialuo_Other_Party",soundText="哇！好丰盛的一餐！我可以先尝尝这个吗？",soundOpen=1},mt),
    ["2003018"]=setmetatable({soundId=2003018,leaderId=2003001,sounType=1,soundName="就餐交谈",characterVoiceName="Vo_Xialuo_Other_PartyFriend",soundText="嗯？！这个是，享誉各地的甜品吗？！我可以尝尝吗？真的吗？！",soundOpen=8},mt),
    ["2003019"]=setmetatable({soundId=2003019,leaderId=2003001,sounType=1,soundName="特定节日祝福",characterVoiceName="Vo_Xialuo_Other_Festival",soundText="导师，我猜你一定给夏洛准备了一份大礼对不对！导师你是不是在想‘夏洛不是小孩子了所以没有准备大礼’？今天可是夏洛的生日！",soundOpen=9},mt),
    ["2003020"]=setmetatable({soundId=2003020,leaderId=2003001,sounType=1,soundName="导师生日祝福",characterVoiceName="Vo_Xialuo_Other_PlayerBirth",soundText="导师生日快乐！这是夏洛思考了超级久后才决定的礼物，请收下吧！虽然完完全全比不上导师送给夏洛的礼物，但是！还是希望导师你能够喜欢~",soundOpen=10},mt),
