    ["2004006"]=setmetatable({soundId=2004006,leaderId=2004001,sounType=1,soundName="不期而遇",characterVoiceName="Vo_Weila_Main_Special",soundText="导师，你来的正好，晚间的训练刚刚开始，如果没有要紧的事就去参加训练吧。法尼娅她们也在那边，保持绝佳的身体素质也是十分重要的一环。",soundOpen=1},mt),
    ["2004007"]=setmetatable({soundId=2004007,leaderId=2004001,sounType=1,soundName="交流",characterVoiceName="Vo_Weila_Main_Talk1",soundText="战斗方式？这可没有什么复杂的理由。不能做到快速汇聚源能击杀敌人，就只能被敌人击杀，就是这么简单。",soundOpen=1},mt),
    ["2004008"]=setmetatable({soundId=2004008,leaderId=2004001,sounType=1,soundName="答辞",characterVoiceName="Vo_Weila_Main_Talk2",soundText="我们身后那个庞然大物，藏有太多的秘密了，我也只是窥见了它的冰山一角。我需要你的力量去找出它更多的秘密，斯露德不应当就这样受它们的摆布。至少，给我的过去有个交代。",soundOpen=1},mt),
    ["2004009"]=setmetatable({soundId=2004009,leaderId=2004001,sounType=1,soundName="至交",characterVoiceName="Vo_Weila_Main_Talk3",soundText="如果有一天你了解到我的过去也请不要流露出同情的表情。",soundOpen=1},mt),
    ["2004010"]=setmetatable({soundId=2004010,leaderId=2004001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Weila_Main_Talk4",soundText="稍微有些习惯现在的生活了啊，不得不说你做的很好啊，搭档。嗯？为什么是搭档？不，不要在意，只是将合作者换了一种说法而已。嗯。",soundOpen=1},mt),
    ["2004011"]=setmetatable({soundId=2004011,leaderId=2004001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Weila_Main_Online",soundText="精神是意志力的基础，还请劳逸结合，导师。",soundOpen=6},mt),
    ["2004012"]=setmetatable({soundId=2004012,leaderId=2004001,sounType=1,soundName="摇晃",characterVoiceName="Vo_Weila_Main_Shake",soundText="……嗯？抗眩晕训练吗？",soundOpen=5},mt),
