    ["2004016"]=setmetatable({soundId=2004016,leaderId=2004001,sounType=1,soundName="邀约",characterVoiceName="Vo_Weila_Main_Assistant",soundText="导师你找我么？我的任务还没有完成，如果没有要紧的事情，我就先……不，我还是陪陪你好了。",soundOpen=1},mt),
