    ["20050001"]=setmetatable({soundId=20050001,leaderId=2005001,sounType=1,soundName="白昼的问候",characterVoiceName="Vo_Waxiti_Main_Login_Day",soundText="导师，要喝杯茶么？",soundOpen=1},mt),
    ["20050002"]=setmetatable({soundId=20050002,leaderId=2005001,sounType=1,soundName="白昼的致意",characterVoiceName="Vo_Waxiti_Main_Login_DayUp",soundText="刚好我正在想你什么时候会来，你就出现了。",soundOpen=1},mt),
    ["20050003"]=setmetatable({soundId=20050003,leaderId=2005001,sounType=1,soundName="夜幕的问候",characterVoiceName="Vo_Waxiti_Main_Login_Night",soundText="晚上好，导师。",soundOpen=1},mt),
    ["20050004"]=setmetatable({soundId=20050004,leaderId=2005001,sounType=1,soundName="夜幕的致意",characterVoiceName="Vo_Waxiti_Main_Login_NightUp",soundText="又见面了，你也很喜欢这里吗？",soundOpen=1},mt),
    ["20050005"]=setmetatable({soundId=20050005,leaderId=2005001,sounType=1,soundName="久违",characterVoiceName="Vo_Waxiti_Main_Offline",soundText="好久不见，让我猜猜，你是有了新的研究成果么？如果方便的话，可以讲给我听吗？",soundOpen=7},mt),
    ["20050006"]=setmetatable({soundId=20050006,leaderId=2005001,sounType=1,soundName="不期而遇",characterVoiceName="Vo_Waxiti_Main_Special",soundText="早上好导师，你也是来观察源能海的变化吗？",soundOpen=1},mt),
    ["20050007"]=setmetatable({soundId=20050007,leaderId=2005001,sounType=1,soundName="交流",characterVoiceName="Vo_Waxiti_Main_Talk1",soundText="我知道很多，但也有很多不知道的，学无止境。",soundOpen=1},mt),
    ["20050008"]=setmetatable({soundId=20050008,leaderId=2005001,sounType=1,soundName="答辞",characterVoiceName="Vo_Waxiti_Main_Talk2",soundText="维拉小姐总是对我抱有强烈的敌意，是因为……我不小心把她的布丁吃掉了吗？",soundOpen=1},mt),
    ["20050009"]=setmetatable({soundId=20050009,leaderId=2005001,sounType=1,soundName="至交",characterVoiceName="Vo_Waxiti_Main_Talk3",soundText="你想从我这里知道什么呢？关于星辰和大地，还是REVO的秘密呢？又或者，只是关于我？",soundOpen=1},mt),
    ["20050010"]=setmetatable({soundId=20050010,leaderId=2005001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Waxiti_Main_Talk4",soundText="我所知晓的信息，已经全部告诉你了哦。我只是一位研究者，对于我来说，并没有需要隐藏的秘密，或许，我也只是REVO手中的一枚棋子。",soundOpen=1},mt),
    ["20050011"]=setmetatable({soundId=20050011,leaderId=2005001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Waxiti_Main_Online",soundText="稍微休息一下吧，张弛有度才是最健康的学习方法。",soundOpen=6},mt),
    ["20050012"]=setmetatable({soundId=20050012,leaderId=2005001,sounType=1,soundName="摇晃",characterVoiceName="Vo_Waxiti_Main_Shake",soundText="有些天旋地转的，是我，看书看太久的后遗症吗？",soundOpen=5},mt),
    ["20050013"]=setmetatable({soundId=20050013,leaderId=2005001,sounType=1,soundName="闲趣",characterVoiceName="Vo_Waxiti_Main_Click_Continue",soundText="嗯？你说吧，我在听哦。",soundOpen=1},mt),
    ["20050014"]=setmetatable({soundId=20050014,leaderId=2005001,sounType=1,soundName="伫立",characterVoiceName="Vo_Waxiti_Main_Idle1",soundText="怎么？有什么事么？",soundOpen=1},mt),
    ["20050015"]=setmetatable({soundId=20050015,leaderId=2005001,sounType=1,soundName="索然",characterVoiceName="Vo_Waxiti_Main_Idle2",soundText="书中记载，大地之上四季轮替景色交错，然而同样是山脉，极夜山脉常年积雪，索尔拉斯山脉却常年炽热无比，难道……唔。",soundOpen=1},mt),
