    ["2010007"]=setmetatable({soundId=2010007,leaderId=2010001,sounType=1,soundName="交流",characterVoiceName="Vo_Alaixiya_Main_Talk1",soundText="符文和源能之间的联系可是很深奥的，我已经整理出来几种假说啦，不过凡人看不懂也是很正常的吧，毕竟是本天才费尽心思的杰作。",soundOpen=1},mt),
    ["2010008"]=setmetatable({soundId=2010008,leaderId=2010001,sounType=1,soundName="答辞",characterVoiceName="Vo_Alaixiya_Main_Talk2",soundText="符文研究其实是需要很多人力的，不过一般人不愿意配合我吧。喂，别用这种眼神看我！我对自己不受欢迎这种事还是挺清楚啦。",soundOpen=1},mt),
    ["2010009"]=setmetatable({soundId=2010009,leaderId=2010001,sounType=1,soundName="至交",characterVoiceName="Vo_Alaixiya_Main_Talk3",soundText="小橘……？叫我吗……？啊！耶拉她们又给我起外号了是吧？！",soundOpen=1},mt),
    ["2010010"]=setmetatable({soundId=2010010,leaderId=2010001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Alaixiya_Main_Talk4",soundText="以前做私人研究的时候，我一直都是独来独往的，但是阐释工坊的人却总是会主动黏过来，现在瓦哈纳的人也是，真烦人呀……嘿嘿。",soundOpen=1},mt),
    ["2010011"]=setmetatable({soundId=2010011,leaderId=2010001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Alaixiya_Main_Online",soundText="就算天才如我，也需要适当的休息才能提升效率……听懂了吗？哎呀！我让你注意休息！",soundOpen=6},mt),
    ["2010012"]=setmetatable({soundId=2010012,leaderId=2010001,sounType=1,soundName="摇晃",characterVoiceName="Vo_Alaixiya_Main_Shake",soundText="先声明，这个晃动可不是我的实验导致的。",soundOpen=5},mt),
    ["2010013"]=setmetatable({soundId=2010013,leaderId=2010001,sounType=1,soundName="闲趣",characterVoiceName="Vo_Alaixiya_Main_Click_Continue",soundText="干嘛？本天才可忙着呢。",soundOpen=1},mt),
    ["2010014"]=setmetatable({soundId=2010014,leaderId=2010001,sounType=1,soundName="伫立",characterVoiceName="Vo_Alaixiya_Main_Idle1",soundText="东部遗迹内的符文编写习惯和西部的有很大不同，这明显和世界树的地理位置有关联。",soundOpen=1},mt),
    ["2010015"]=setmetatable({soundId=2010015,leaderId=2010001,sounType=1,soundName="索然",characterVoiceName="Vo_Alaixiya_Main_Idle2",soundText="只要有足够高的研究效率，多休息一会也没关系啦。",soundOpen=1},mt),
    ["2010016"]=setmetatable({soundId=2010016,leaderId=2010001,sounType=1,soundName="邀约",characterVoiceName="Vo_Alaixiya_Main_Assistant",soundText="只要有本天才在，什么问题都能解决啦,快点让外行们都停下手里的活吧。",soundOpen=1},mt),
    ["2010017"]=setmetatable({soundId=2010017,leaderId=2010001,sounType=1,soundName="就餐问候",characterVoiceName="Vo_Alaixiya_Other_Party",soundText="在尼伯赞歌也是大家聚在一起吃饭吗？嗯……不错的设计",soundOpen=1},mt),
    ["2010018"]=setmetatable({soundId=2010018,leaderId=2010001,sounType=1,soundName="就餐交谈",characterVoiceName="Vo_Alaixiya_Other_PartyFriend",soundText="想不到导师这种原始人也懂美食啊，不过还差得远呢，本天才就勉为其难抽出两个小时的时间给你讲解一下大陆各地的儿童套餐之间的区别与渊源吧。",soundOpen=8},mt),
