    ["2012007"]=setmetatable({soundId=2012007,leaderId=2012001,sounType=1,soundName="交流",characterVoiceName="Vo_Taweier_Main_Talk1",soundText="想做什么就做什么？拉普兰的日子其实也没有导师你想象中的那么惬意啦。比起那个，我其实更希望白能够过上“不想做的事就可以不做”的生活。",soundOpen=1},mt),
