    ["2012019"]=setmetatable({soundId=2012019,leaderId=2012001,sounType=1,soundName="特定节日祝福",characterVoiceName="Vo_Taweier_Other_Festival",soundText="今天是拉普兰那边的传统节日，导师要是有空的话，就过来一起热闹一下吧，顺带一提，今天能看到绝赞的节日限定版小白哦！白，最棒了！",soundOpen=9},mt),
    ["2012020"]=setmetatable({soundId=2012020,leaderId=2012001,sounType=1,soundName="导师生日祝福",characterVoiceName="Vo_Taweier_Other_PlayerBirth",soundText="导师，生日快乐，其实白给你准备了一个小小的惊喜，但她又有点害羞，所以这种时候就需要我出场了，锵！怎么样，白的冰造蛋糕，很漂亮吧？别露出那种表情啊，这可是白的心意，要满怀感激的吃掉哦~",soundOpen=10},mt),
