    ["2013006"]=setmetatable({soundId=2013006,leaderId=2013001,sounType=1,soundName="不期而遇",characterVoiceName="Vo_Lei_Main_Special",soundText="导师，已经这么晚了，不好好休息可不行。我？我……只是在监督你而已！",soundOpen=1},mt),
    ["2013007"]=setmetatable({soundId=2013007,leaderId=2013001,sounType=1,soundName="交流",characterVoiceName="Vo_Lei_Main_Talk1",soundText="“帆”的出现对人的影响究竟是好是坏，关于这一点，我想听听您的看法，导师。",soundOpen=1},mt),
    ["2013008"]=setmetatable({soundId=2013008,leaderId=2013001,sounType=1,soundName="答辞",characterVoiceName="Vo_Lei_Main_Talk2",soundText="虽然格薇德林大人的功勋令人敬佩，可是在这个时代，战斗……真的还有意义吗？",soundOpen=1},mt),
    ["2013009"]=setmetatable({soundId=2013009,leaderId=2013001,sounType=1,soundName="至交",characterVoiceName="Vo_Lei_Main_Talk3",soundText="什么时候，我也能成为像格薇德林大人那样独当一面的人呢？虽然她乱来的时候也让人很头痛就是了……",soundOpen=1},mt),
    ["2013010"]=setmetatable({soundId=2013010,leaderId=2013001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Lei_Main_Talk4",soundText="导师，最近身体有什么异样吗？啊，抱歉，这么问很奇怪吧？其实我对您的身体状况有些好奇……",soundOpen=1},mt),
    ["2013011"]=setmetatable({soundId=2013011,leaderId=2013001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Lei_Main_Online",soundText="导师，要注意休息哦，就算是你，长时间保持这种状态也是会出问题的。",soundOpen=6},mt),
    ["2013012"]=setmetatable({soundId=2013012,leaderId=2013001,sounType=1,soundName="摇晃",characterVoiceName="Vo_Lei_Main_Shake",soundText="出什么事了？",soundOpen=5},mt),
