    ["2013015"]=setmetatable({soundId=2013015,leaderId=2013001,sounType=1,soundName="索然",characterVoiceName="Vo_Lei_Main_Idle2",soundText="导师，其实我对你的经历有点好奇，能和我说说你过去的事吗？",soundOpen=1},mt),
    ["2013016"]=setmetatable({soundId=2013016,leaderId=2013001,sounType=1,soundName="邀约",characterVoiceName="Vo_Lei_Main_Assistant",soundText="要出去透气吗？嗯，也好，呼吸新鲜的空气能让人感到放松。",soundOpen=1},mt),
    ["2013017"]=setmetatable({soundId=2013017,leaderId=2013001,sounType=1,soundName="就餐问候",characterVoiceName="Vo_Lei_Other_Party",soundText="是很棒的菜式呢，看得出来您有认真准备，导师。",soundOpen=1},mt),
    ["2013018"]=setmetatable({soundId=2013018,leaderId=2013001,sounType=1,soundName="就餐交谈",characterVoiceName="Vo_Lei_Other_PartyFriend",soundText="啊~和格薇德林大人一起用餐，感觉连食物都变得更美味了呢。",soundOpen=8},mt),
    ["2013019"]=setmetatable({soundId=2013019,leaderId=2013001,sounType=1,soundName="特定节日祝福",characterVoiceName="Vo_Lei_Other_Festival",soundText="导师，今天是希利克斯海文每年一度的螺旋礼诞，据说这是一种对树崇拜的古老传统的沿袭，不过那不重要，我觉得让活在当下的人们能有片刻休憩才是节日存在的意义，总而言之，今天就放下那些让你反感，却又不得不做的事，好好休息一下吧。",soundOpen=9},mt),
    ["2013020"]=setmetatable({soundId=2013020,leaderId=2013001,sounType=1,soundName="导师生日祝福",characterVoiceName="Vo_Lei_Other_PlayerBirth",soundText="导师，生日快乐，这是上次的回礼，虽然不擅长料理，不过我研究了一下发现本质上跟药理有一些相通的地方，所以还有有一些自信的，要仔细品尝哦。",soundOpen=10},mt),
    ["2013021"]=setmetatable({soundId=2013021,leaderId=2013001,sounType=2,soundName="入队",characterVoiceName="Vo_Lei_Battle_JoinTeam",soundText="诶？这次行动需要我吗？",soundOpen=1},mt),
    ["2013022"]=setmetatable({soundId=2013022,leaderId=2013001,sounType=2,soundName="队长号令Ⅰ",characterVoiceName="Vo_Lei_Battle_Leader_01",soundText="医疗支援，请交给我。",soundOpen=1},mt),
