    ["2013024"]=setmetatable({soundId=2013024,leaderId=2013001,sounType=2,soundName="危急Ⅰ",characterVoiceName="Vo_Lei_Battle_AgonalStage1",soundText="现在正是需要我的时候！",soundOpen=1},mt),
