    ["2014001"]=setmetatable({soundId=2014001,leaderId=2014001,sounType=1,soundName="白昼的问候",characterVoiceName="Vo_Guimo_Main_Login_Day",soundText="嘘，还差一点儿就凝聚成功了……好了，完成。",soundOpen=1},mt),
    ["2014002"]=setmetatable({soundId=2014002,leaderId=2014001,sounType=1,soundName="白昼的致意",characterVoiceName="Vo_Guimo_Main_Login_DayUp",soundText="我给你变个戏法吧，看好了。呼，燃烧吧，尼伯赞歌号！呵呵，骗你的，偶尔想这样玩一次。",soundOpen=1},mt),
    ["2014003"]=setmetatable({soundId=2014003,leaderId=2014001,sounType=1,soundName="夜幕的问候",characterVoiceName="Vo_Guimo_Main_Login_Night",soundText="倘若真的手可摘星辰该多好啊……",soundOpen=1},mt),
    ["2014004"]=setmetatable({soundId=2014004,leaderId=2014001,sounType=1,soundName="夜幕的致意",characterVoiceName="Vo_Guimo_Main_Login_NightUp",soundText="在极夜之地，星辰的明晦是时间感知的参照，记住它们的所在，别迷失了航向。",soundOpen=1},mt),
    ["2014005"]=setmetatable({soundId=2014005,leaderId=2014001,sounType=1,soundName="久违",characterVoiceName="Vo_Guimo_Main_Offline",soundText="被遗忘之人终于回归……哦？你可以猜一猜，“被遗忘之人”到底是你，还是我呢？",soundOpen=7},mt),
    ["2014006"]=setmetatable({soundId=2014006,leaderId=2014001,sounType=1,soundName="不期而遇",characterVoiceName="Vo_Guimo_Main_Special",soundText="我喜欢光，即便有时候这种炫目的物质具有强烈的攻击性，比如现在。呼，有点热了啊……",soundOpen=1},mt),
    ["2014007"]=setmetatable({soundId=2014007,leaderId=2014001,sounType=1,soundName="交流",characterVoiceName="Vo_Guimo_Main_Talk1",soundText="文献馆里发光的石板我可以拿走一块吗？不能？那真是可惜了。",soundOpen=1},mt),
    ["2014008"]=setmetatable({soundId=2014008,leaderId=2014001,sounType=1,soundName="答辞",characterVoiceName="Vo_Guimo_Main_Talk2",soundText="……昨夜的晚餐，加了很多胡萝卜和生菜，导师，这不是你的恶作剧吧？我已经是大人了，这些蔬菜还是留给孩子们吧。",soundOpen=1},mt),
    ["2014009"]=setmetatable({soundId=2014009,leaderId=2014001,sounType=1,soundName="至交",characterVoiceName="Vo_Guimo_Main_Talk3",soundText="相比较于第一盏茶的苦和第二盏茶的甜，我更喜欢第三盏茶的平淡，能够稀释狂躁的血液，让我静下心来，你要尝一尝吗？",soundOpen=1},mt),
    ["2014010"]=setmetatable({soundId=2014010,leaderId=2014001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Guimo_Main_Talk4",soundText="不知道顾途有没有顺利完成任务……啊，我不是担心她，她比我要强得多，无论怎样的敌人都能够轻松解决，只是在做任务的时候，她总是会溜去酒馆，偶尔还会忘记任务的期限，导致任务失败。这一点让许多成员都有些头疼啊，哈哈。",soundOpen=1},mt),
    ["2014011"]=setmetatable({soundId=2014011,leaderId=2014001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Guimo_Main_Online",soundText="太过沉迷一件事情并不是好事，当心走火入魔。",soundOpen=6},mt),
    ["2014012"]=setmetatable({soundId=2014012,leaderId=2014001,sounType=1,soundName="摇晃",characterVoiceName="Vo_Guimo_Main_Shake",soundText="没想到你也会做恶作剧啊，呵呵。",soundOpen=5},mt),
    ["2014013"]=setmetatable({soundId=2014013,leaderId=2014001,sounType=1,soundName="闲趣",characterVoiceName="Vo_Guimo_Main_Click_Continue",soundText="嘶，我很怕痒的，请不要这样。",soundOpen=1},mt),
    ["2014014"]=setmetatable({soundId=2014014,leaderId=2014001,sounType=1,soundName="伫立",characterVoiceName="Vo_Guimo_Main_Idle1",soundText="咳……咳咳……唔，说点什么吧？",soundOpen=1},mt),
    ["2014015"]=setmetatable({soundId=2014015,leaderId=2014001,sounType=1,soundName="索然",characterVoiceName="Vo_Guimo_Main_Idle2",soundText="呼，嘿！呵呵……嘶！哈，一点都不乖。",soundOpen=1},mt),
    ["2014016"]=setmetatable({soundId=2014016,leaderId=2014001,sounType=1,soundName="邀约",characterVoiceName="Vo_Guimo_Main_Assistant",soundText="选择了我吗，万分感谢。那么，就让我来听一听你要讲述的故事吧，作为等价交换，我也会毫不吝啬地讲述我的故事。",soundOpen=1},mt),
    ["2014017"]=setmetatable({soundId=2014017,leaderId=2014001,sounType=1,soundName="就餐问候",characterVoiceName="Vo_Guimo_Other_Party",soundText="我？好，正好想尝尝各地的食物。",soundOpen=1},mt),
    ["2014018"]=setmetatable({soundId=2014018,leaderId=2014001,sounType=1,soundName="就餐交谈",characterVoiceName="Vo_Guimo_Other_PartyFriend",soundText="之前赫尔薇教了我一些你们那边的用餐礼仪，不知道我做得对不对呢。",soundOpen=8},mt),
    ["2014019"]=setmetatable({soundId=2014019,leaderId=2014001,sounType=1,soundName="特定节日祝福",characterVoiceName="Vo_Guimo_Other_Festival",soundText="中秋快乐。据顾途所说，今天是团圆夜，是流浪之人与家人团聚的日子……家人吗，我的家人就是你和南方制造的成员们吧。对了，我做了一些被称为‘月饼’的甜点，有机会的话请务必尝一尝。",soundOpen=9},mt),
