    ["2014037"]=setmetatable({soundId=2014037,leaderId=2014001,sounType=2,soundName="战斗失败",characterVoiceName="Vo_Guimo_Battle_Lose",soundText="是我高看你了吗？我很抱歉。",soundOpen=1},mt),
    ["2015001"]=setmetatable({soundId=2015001,leaderId=2015001,sounType=1,soundName="白昼的问候",characterVoiceName="Vo_Heerwei_Main_Login_Day",soundText="准备好了的话，就出发吧，不要想着偷懒哦！",soundOpen=1},mt),
    ["2015002"]=setmetatable({soundId=2015002,leaderId=2015001,sounType=1,soundName="白昼的致意",characterVoiceName="Vo_Heerwei_Main_Login_DayUp",soundText="导师，你来的时候有看到椿那家伙吗？揍她？不，我只是要让她把我水杯里的那堆东西，全部，一滴不剩地喝完。",soundOpen=1},mt),
    ["2015003"]=setmetatable({soundId=2015003,leaderId=2015001,sounType=1,soundName="夜幕的问候",characterVoiceName="Vo_Heerwei_Main_Login_Night",soundText="呜哇！别过来！！……哎？是导师啊，可，可以把那边的灯打开吗？",soundOpen=1},mt),
    ["2015004"]=setmetatable({soundId=2015004,leaderId=2015001,sounType=1,soundName="夜幕的致意",characterVoiceName="Vo_Heerwei_Main_Login_NightUp",soundText="导师，可以再靠近一点吗？我稍微有点，不太适应这种黑暗的环境……光线，有点太暗了。",soundOpen=1},mt),
    ["2015005"]=setmetatable({soundId=2015005,leaderId=2015001,sounType=1,soundName="久违",characterVoiceName="Vo_Heerwei_Main_Offline",soundText="你这家伙还知道回来啊？……不，我是说，你让我等了很久啊。",soundOpen=7},mt),
    ["2015006"]=setmetatable({soundId=2015006,leaderId=2015001,sounType=1,soundName="不期而遇",characterVoiceName="Vo_Heerwei_Main_Special",soundText="早啊导师，早起锻炼已经是我的一种习惯了，你也有这种习惯吗？那，以后要相约一起去锻炼身体吗？",soundOpen=1},mt),
    ["2015007"]=setmetatable({soundId=2015007,leaderId=2015001,sounType=1,soundName="交流",characterVoiceName="Vo_Heerwei_Main_Talk1",soundText="肮脏的生物是不可信的……对，对不起，我又说出了这种词！呜……",soundOpen=1},mt),
    ["2015008"]=setmetatable({soundId=2015008,leaderId=2015001,sounType=1,soundName="答辞",characterVoiceName="Vo_Heerwei_Main_Talk2",soundText="导师，如果看到椿了，可以转告她吗？“我不小心把芦荟汁打翻在她的被子上了，真是不好意思呢”。",soundOpen=1},mt),
    ["2015009"]=setmetatable({soundId=2015009,leaderId=2015001,sounType=1,soundName="至交",characterVoiceName="Vo_Heerwei_Main_Talk3",soundText="南方制造有很多队伍，天车只是其中的一支，据我所知的成员就有五位，虽然……咦？你的表情怎么……她们没有告诉你还有一位成员吗？！",soundOpen=1},mt),
    ["2015010"]=setmetatable({soundId=2015010,leaderId=2015001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Heerwei_Main_Talk4",soundText="椿她……从来不肯讲自己的事，但是她千方百计想要遮挡起来的痕迹足以说明她经历了什么。导师，如果有机会了解到她的过去，能否代替我给她一个拥抱？……我为什么不自己去？这，这种事想想也没可能的吧，我见到那个家伙只想一棍子敲晕她！",soundOpen=1},mt),
    ["2015011"]=setmetatable({soundId=2015011,leaderId=2015001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Heerwei_Main_Online",soundText="如果这个时间没法想明白这些事，为什么不休息一下再来思考呢？",soundOpen=6},mt),
    ["2015012"]=setmetatable({soundId=2015012,leaderId=2015001,sounType=1,soundName="摇晃",characterVoiceName="Vo_Heerwei_Main_Shake",soundText="呜哇啊！是椿在捣鬼吗？！",soundOpen=5},mt),
    ["2015013"]=setmetatable({soundId=2015013,leaderId=2015001,sounType=1,soundName="闲趣",characterVoiceName="Vo_Heerwei_Main_Click_Continue",soundText="你最好有重要的事情要跟我说……",soundOpen=1},mt),
    ["2015014"]=setmetatable({soundId=2015014,leaderId=2015001,sounType=1,soundName="伫立",characterVoiceName="Vo_Heerwei_Main_Idle1",soundText="你这是在做什么，假扮木头吗？哼，真可笑。",soundOpen=1},mt),
    ["2015015"]=setmetatable({soundId=2015015,leaderId=2015001,sounType=1,soundName="索然",characterVoiceName="Vo_Heerwei_Main_Idle2",soundText="导师你是又从椿那里学习了什么戏弄我的法子吗？我可不会上当的！",soundOpen=1},mt),
    ["2015016"]=setmetatable({soundId=2015016,leaderId=2015001,sounType=1,soundName="邀约",characterVoiceName="Vo_Heerwei_Main_Assistant",soundText="你找我吗？先说清楚，我可没那么多空闲时间出来闲逛。但是……偶尔陪你聊聊天也不是不行。",soundOpen=1},mt),
    ["2015017"]=setmetatable({soundId=2015017,leaderId=2015001,sounType=1,soundName="就餐问候",characterVoiceName="Vo_Heerwei_Other_Party",soundText="很正式的邀请呢，莫非导师你经常出入各种高级的场合？",soundOpen=1},mt),
    ["2015018"]=setmetatable({soundId=2015018,leaderId=2015001,sounType=1,soundName="就餐交谈",characterVoiceName="Vo_Heerwei_Other_PartyFriend",soundText="椿，今天这种场合，你可不要像平时一样玩餐具啊！",soundOpen=8},mt),
    ["2015019"]=setmetatable({soundId=2015019,leaderId=2015001,sounType=1,soundName="特定节日祝福",characterVoiceName="Vo_Heerwei_Other_Festival",soundText="导师，春节快乐。我给你准备了一些礼物，不是什么非常贵重的东西，你放心收下就好了。",soundOpen=9},mt),
    ["2015020"]=setmetatable({soundId=2015020,leaderId=2015001,sounType=1,soundName="导师生日祝福",characterVoiceName="Vo_Heerwei_Other_PlayerBirth",soundText="导师，收到我的礼物了吗？唔，那句话要怎么说来着……一点薄礼，不成敬意？总之，你能喜欢就好。",soundOpen=10},mt),
    ["2015021"]=setmetatable({soundId=2015021,leaderId=2015001,sounType=2,soundName="入队",characterVoiceName="Vo_Heerwei_Battle_JoinTeam",soundText="我来协助各位了。",soundOpen=1},mt),
