    ["2015036"]=setmetatable({soundId=2015036,leaderId=2015001,sounType=2,soundName="战斗胜利",characterVoiceName="Vo_Heerwei_Battle_Win",soundText="虽然比不上其他人，但胜利也是理所应当的。",soundOpen=1},mt),
    ["2015037"]=setmetatable({soundId=2015037,leaderId=2015001,sounType=2,soundName="战斗失败",characterVoiceName="Vo_Heerwei_Battle_Lose",soundText="再努力一点啊！",soundOpen=1},mt),
    ["2016001"]=setmetatable({soundId=2016001,leaderId=2016001,sounType=1,soundName="白昼的问候",characterVoiceName="Vo_Chun_Main_Login_Day",soundText="小心脚下！……哈哈哈哈哈骗你的！你生气的样子实在太好玩了。",soundOpen=1},mt),
    ["2016002"]=setmetatable({soundId=2016002,leaderId=2016001,sounType=1,soundName="白昼的致意",characterVoiceName="Vo_Chun_Main_Login_DayUp",soundText="导师你看到赫尔薇气急败坏的脸了吗哈哈哈哈……呜哇！她过来了！导师你快帮我挡一下！……呼，还好没被她发现。",soundOpen=1},mt),
    ["2016003"]=setmetatable({soundId=2016003,leaderId=2016001,sounType=1,soundName="夜幕的问候",characterVoiceName="Vo_Chun_Main_Login_Night",soundText="导师！跟在你身后的那个人是谁啊？！……噗，哈哈，哈哈哈哈，你的表情，太好笑了，哈哈哈。",soundOpen=1},mt),
    ["2016004"]=setmetatable({soundId=2016004,leaderId=2016001,sounType=1,soundName="夜幕的致意",characterVoiceName="Vo_Chun_Main_Login_NightUp",soundText="天干物燥，小心火烛……哇着火了着火了！……才怪！哈哈哈！",soundOpen=1},mt),
    ["2016005"]=setmetatable({soundId=2016005,leaderId=2016001,sounType=1,soundName="久违",characterVoiceName="Vo_Chun_Main_Offline",soundText="嗯？呜哇啊啊啊！有鬼啊！！！哎？等等，有腿，你真的是导师本人啊？",soundOpen=7},mt),
    ["2016006"]=setmetatable({soundId=2016006,leaderId=2016001,sounType=1,soundName="不期而遇",characterVoiceName="Vo_Chun_Main_Special",soundText="导师？！你也是来偷看赫尔薇出糗的吗？来来来，这里是个绝佳的好位置……噗哈哈哈哈，快看她，太好玩了！哈哈哈哈！",soundOpen=1},mt),
    ["2016007"]=setmetatable({soundId=2016007,leaderId=2016001,sounType=1,soundName="交流",characterVoiceName="Vo_Chun_Main_Talk1",soundText="不要试图揭开我的面具，这里寄宿了某种诅咒，一旦揭开就会附着到你的身上，然后你也会和我一样变得丑陋……哈哈哈哈逗你玩的！",soundOpen=1},mt),
    ["2016008"]=setmetatable({soundId=2016008,leaderId=2016001,sounType=1,soundName="答辞",characterVoiceName="Vo_Chun_Main_Talk2",soundText="屏气凝神！去感受空气的流动，慢慢地，将注意力集中在你的目标上，对，就像这样，保持住……噗，你是不是忘记呼吸了，脸都憋红了哈哈哈哈哈。",soundOpen=1},mt),
    ["2016009"]=setmetatable({soundId=2016009,leaderId=2016001,sounType=1,soundName="至交",characterVoiceName="Vo_Chun_Main_Talk3",soundText="不做恶作剧的话会失去很多乐趣的，你也这样认为的吧，不然怎么会来找我呢，对吧.",soundOpen=1},mt),
    ["2016010"]=setmetatable({soundId=2016010,leaderId=2016001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Chun_Main_Talk4",soundText="赫尔薇是不是找到新的有意思的东西了，最近对我的恶作剧都无动于衷，还露出一副怜惜的表情……好在意，十分在意……不行了，导师你快帮我打探一下。噗，哈哈哈哈逗你玩的！",soundOpen=1},mt),
    ["2016011"]=setmetatable({soundId=2016011,leaderId=2016001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Chun_Main_Online",soundText="……你这股认真的劲，真可怕啊。",soundOpen=6},mt),
    ["2016012"]=setmetatable({soundId=2016012,leaderId=2016001,sounType=1,soundName="摇晃",characterVoiceName="Vo_Chun_Main_Shake",soundText="颠簸好严重，赫尔薇她没事吧！",soundOpen=5},mt),
    ["2016013"]=setmetatable({soundId=2016013,leaderId=2016001,sounType=1,soundName="闲趣",characterVoiceName="Vo_Chun_Main_Click_Continue",soundText="不许敲我！我才不是小矮子！",soundOpen=1},mt),
    ["2016014"]=setmetatable({soundId=2016014,leaderId=2016001,sounType=1,soundName="伫立",characterVoiceName="Vo_Chun_Main_Idle1",soundText="不觉得干站着有些无聊吗？你再不说话，我就去找赫尔薇咯……导师？",soundOpen=1},mt),
    ["2016015"]=setmetatable({soundId=2016015,leaderId=2016001,sounType=1,soundName="索然",characterVoiceName="Vo_Chun_Main_Idle2",soundText="咦？那边天上飘着的是什么？哇！导师快看那边！好大一只异生体！……这样都没反应啊？真无聊。",soundOpen=1},mt),
    ["2016016"]=setmetatable({soundId=2016016,leaderId=2016001,sounType=1,soundName="邀约",characterVoiceName="Vo_Chun_Main_Assistant",soundText="哟！导师！你要和我学习怎么制作整蛊道具吗？没问题没问题，交给我，包会！以后我们就是“同伴”了！",soundOpen=1},mt),
    ["2016017"]=setmetatable({soundId=2016017,leaderId=2016001,sounType=1,soundName="就餐问候",characterVoiceName="Vo_Chun_Other_Party",soundText="哦！看上去好棒啊！那我就不客气了嘿嘿~",soundOpen=1},mt),
    ["2016018"]=setmetatable({soundId=2016018,leaderId=2016001,sounType=1,soundName="就餐交谈",characterVoiceName="Vo_Chun_Other_PartyFriend",soundText="啊呀~赫尔薇你是不是遇到什么麻烦了呀~要我帮帮你么~",soundOpen=8},mt),
    ["2016019"]=setmetatable({soundId=2016019,leaderId=2016001,sounType=1,soundName="特定节日祝福",characterVoiceName="Vo_Chun_Other_Festival",soundText="除夕夜快乐导师！其实我还挺害怕鞭炮声的……放鞭炮的时候不要试图来找我！不然有你好果子吃！",soundOpen=9},mt),
    ["2016020"]=setmetatable({soundId=2016020,leaderId=2016001,sounType=1,soundName="导师生日祝福",characterVoiceName="Vo_Chun_Other_PlayerBirth",soundText="导师，生日快乐，喜欢我送你的礼物吗？是不是棒极了~",soundOpen=10},mt),
    ["2016021"]=setmetatable({soundId=2016021,leaderId=2016001,sounType=2,soundName="入队",characterVoiceName="Vo_Chun_Battle_JoinTeam",soundText="团队协作啊？有点困难……",soundOpen=1},mt),
