    ["2024005"]=setmetatable({soundId=2024005,leaderId=2024001,sounType=1,soundName="久违",characterVoiceName="Vo_Aoli_Main_Offline",soundText="啊……哈啊！老大！你一定带了很多有趣的东西回来吧！快给我看看，给我看看！",soundOpen=7},mt),
    ["2024006"]=setmetatable({soundId=2024006,leaderId=2024001,sounType=1,soundName="不期而遇",characterVoiceName="Vo_Aoli_Main_Special",soundText="姆——哈，老大，感受到美好早晨的清新空气了么？是不是很舒适很温和很健康！很适合运动！",soundOpen=1},mt),
    ["2024007"]=setmetatable({soundId=2024007,leaderId=2024001,sounType=1,soundName="交流",characterVoiceName="Vo_Aoli_Main_Talk1",soundText="哎！有什么想做的事情就去做嘛，大不了把知情者统统干掉不就好了。什么？不可以吗？但是斯娜弗尔就是这样做的呀……唔嗯……？",soundOpen=1},mt),
    ["2024008"]=setmetatable({soundId=2024008,leaderId=2024001,sounType=1,soundName="答辞",characterVoiceName="Vo_Aoli_Main_Talk2",soundText="你是老大，我当然听你的！除了斯娜弗尔，剔骨，康斯坦丁……除了她们以外，我当然听你的！",soundOpen=1},mt),
    ["2024009"]=setmetatable({soundId=2024009,leaderId=2024001,sounType=1,soundName="至交",characterVoiceName="Vo_Aoli_Main_Talk3",soundText="她们说只有把这群坏东西撕得粉碎，这些坏东西才不会继续祸害我们。这样不对吗？咦？太残暴？这种事情我不懂哎——你教教我吧！",soundOpen=1},mt),
    ["2024010"]=setmetatable({soundId=2024010,leaderId=2024001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Aoli_Main_Talk4",soundText="老，老大，你有没有心跳加快，大脑空白，身边的空气都变热了一样的感觉？我好像，现在，有一点……唔……在剔骨身边的时候也会这样，是生病了么？果然是我平时运动量不足，得加大训练量才行！",soundOpen=1},mt),
    ["2024011"]=setmetatable({soundId=2024011,leaderId=2024001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Aoli_Main_Online",soundText="老大，你，真的，不要，休息一下，么？我，我的头，好晕。唔姆姆——呀嘿！",soundOpen=6},mt),
    ["2024012"]=setmetatable({soundId=2024012,leaderId=2024001,sounType=1,soundName="摇晃",characterVoiceName="Vo_Aoli_Main_Shake",soundText="是训练吗？是训练吧！",soundOpen=5},mt),
    ["2024013"]=setmetatable({soundId=2024013,leaderId=2024001,sounType=1,soundName="闲趣",characterVoiceName="Vo_Aoli_Main_Click_Continue",soundText="嗯？",soundOpen=1},mt),
    ["2024014"]=setmetatable({soundId=2024014,leaderId=2024001,sounType=1,soundName="伫立",characterVoiceName="Vo_Aoli_Main_Idle1",soundText="一停下来就想睡觉，老大，我可以去睡一会儿吗？",soundOpen=1},mt),
    ["2024015"]=setmetatable({soundId=2024015,leaderId=2024001,sounType=1,soundName="索然",characterVoiceName="Vo_Aoli_Main_Idle2",soundText="嗯，想出去啊，我现在偷偷溜走老大也不会发现的吧。嘛，还是算了。",soundOpen=1},mt),
