    ["2024018"]=setmetatable({soundId=2024018,leaderId=2024001,sounType=1,soundName="就餐交谈",characterVoiceName="Vo_Aoli_Other_PartyFriend",soundText="嘿嘿，加利福你可真了解我，饭当然是别人碗里的最好吃啦！",soundOpen=8},mt),
