    ["2027003"]=setmetatable({soundId=2027003,leaderId=2027001,sounType=1,soundName="夜幕的问候",characterVoiceName="Vo_Chaohu_Main_Login_Night",soundText="您好",soundOpen=1},mt),
    ["2027004"]=setmetatable({soundId=2027004,leaderId=2027001,sounType=1,soundName="夜幕的致意",characterVoiceName="Vo_Chaohu_Main_Login_NightUp",soundText="嘶——嘿嘿，晚风吹来湿润的空气感觉就像在水里游泳一样呢——啊嗯……",soundOpen=1},mt),
    ["2027005"]=setmetatable({soundId=2027005,leaderId=2027001,sounType=1,soundName="久违",characterVoiceName="Vo_Chaohu_Main_Offline",soundText="导师，您不在的时间潮水涨落了至少15次呢，唔，还是150次来着……",soundOpen=7},mt),
    ["2027006"]=setmetatable({soundId=2027006,leaderId=2027001,sounType=1,soundName="不期而遇",characterVoiceName="Vo_Chaohu_Main_Special",soundText="有研究表明，现在是一天中空气最湿润的时间，不过对我来说还远远不够，哈……好想下水啊……",soundOpen=1},mt),
    ["2027007"]=setmetatable({soundId=2027007,leaderId=2027001,sounType=1,soundName="交流",characterVoiceName="Vo_Chaohu_Main_Talk1",soundText="天空中漂浮的地层也会发现鱼龙的化石。鱼龙，真是一种美妙而高贵的古老生物呀。",soundOpen=1},mt),
    ["2027008"]=setmetatable({soundId=2027008,leaderId=2027001,sounType=1,soundName="答辞",characterVoiceName="Vo_Chaohu_Main_Talk2",soundText="每天多游泳，多吃一点小鱼干，感觉自己就能更加了解鱼龙呢",soundOpen=1},mt),
    ["2027009"]=setmetatable({soundId=2027009,leaderId=2027001,sounType=1,soundName="至交",characterVoiceName="Vo_Chaohu_Main_Talk3",soundText="如果我们的祖先是鱼龙的话，该多浪漫啊，你看，鱼龙的那条脊椎的曲线，和人类很像吧？",soundOpen=1},mt),
    ["2027010"]=setmetatable({soundId=2027010,leaderId=2027001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Chaohu_Main_Talk4",soundText="三叶感觉很可靠呢，不过她的理论我不能接受，三叶虫怎么可能进化成人类呢……",soundOpen=1},mt),
    ["2027011"]=setmetatable({soundId=2027011,leaderId=2027001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Chaohu_Main_Online",soundText="导师，请休息一下吧，太过努力会在人类进化之前就被淘汰的……",soundOpen=6},mt),
    ["2027012"]=setmetatable({soundId=2027012,leaderId=2027001,sounType=1,soundName="摇晃",characterVoiceName="Vo_Chaohu_Main_Shake",soundText="啊，保护鱼鱼",soundOpen=5},mt),
