    ["2027015"]=setmetatable({soundId=2027015,leaderId=2027001,sounType=1,soundName="索然",characterVoiceName="Vo_Chaohu_Main_Idle2",soundText="好想吃小鱼干……",soundOpen=1},mt),
    ["2027016"]=setmetatable({soundId=2027016,leaderId=2027001,sounType=1,soundName="邀约",characterVoiceName="Vo_Chaohu_Main_Assistant",soundText="是有关于鱼龙的问题要问我吗？",soundOpen=1},mt),
    ["2027017"]=setmetatable({soundId=2027017,leaderId=2027001,sounType=1,soundName="就餐问候",characterVoiceName="Vo_Chaohu_Other_Party",soundText="普通的菜肴，唔……如果能加一些小鱼干就好了",soundOpen=1},mt),
    ["2027018"]=setmetatable({soundId=2027018,leaderId=2027001,sounType=1,soundName="就餐交谈",characterVoiceName="Vo_Chaohu_Other_PartyFriend",soundText="我对于营养均衡之类的不是很清楚，三叶总是会因为这个批评我……",soundOpen=8},mt),
    ["2027019"]=setmetatable({soundId=2027019,leaderId=2027001,sounType=1,soundName="特定节日祝福",characterVoiceName="Vo_Chaohu_Other_Festival",soundText="导师，因为月球的引力，今天的潮汐十分汹涌，源能海的波浪也更加澎湃了。这些月光想必也播撒在远古的海面上吧。月光下古老的生命随着潮水涨落缓缓游动，真是太浪漫了。",soundOpen=9},mt),
    ["2027020"]=setmetatable({soundId=2027020,leaderId=2027001,sounType=1,soundName="导师生日祝福",characterVoiceName="Vo_Chaohu_Other_PlayerBirth",soundText="导师，祝您生日快乐。虽然也很想送给您一些昂贵的礼物，但是三叶说我们的经费很吃紧呢，作为替代，送给您一些富含营养的小鱼干吧，很好吃的。",soundOpen=10},mt),
