    ["2029006"]=setmetatable({soundId=2029006,leaderId=2029001,sounType=1,soundName="不期而遇",characterVoiceName="Vo_Sanye_Main_Special",soundText="早上8点，准时打卡。",soundOpen=1},mt),
    ["2029007"]=setmetatable({soundId=2029007,leaderId=2029001,sounType=1,soundName="交流",characterVoiceName="Vo_Sanye_Main_Talk1",soundText="小小的但又超级懂得自保的生存战略，三叶虫这种生物果然和我很像吧，应该说我就是三叶虫进化来的吧。",soundOpen=1},mt),
    ["2029008"]=setmetatable({soundId=2029008,leaderId=2029001,sounType=1,soundName="答辞",characterVoiceName="Vo_Sanye_Main_Talk2",soundText="人类太脆弱了，变成斯露德之后的防御力才可能有三叶虫那样的强度吧。",soundOpen=1},mt),
    ["2029009"]=setmetatable({soundId=2029009,leaderId=2029001,sounType=1,soundName="至交",characterVoiceName="Vo_Sanye_Main_Talk3",soundText="感觉那个叫奈纳的斯露德和我有相同的气场呢。",soundOpen=1},mt),
    ["2029010"]=setmetatable({soundId=2029010,leaderId=2029001,sounType=1,soundName="坦诚",characterVoiceName="Vo_Sanye_Main_Talk4",soundText="和巢湖在一起的时候总是不由自主逞强呢，明明那么大的个子却感觉比我还弱呢，哈哈。",soundOpen=1},mt),
    ["2029011"]=setmetatable({soundId=2029011,leaderId=2029001,sounType=1,soundName="沉溺劝勉",characterVoiceName="Vo_Sanye_Main_Online",soundText="导师，工作时间太久了哦，你干活又没工资拿",soundOpen=6},mt),
