    ["2029014"]=setmetatable({soundId=2029014,leaderId=2029001,sounType=1,soundName="伫立",characterVoiceName="Vo_Sanye_Main_Idle1",soundText="一个三叶虫化石一到两个银币，每月出土大概一百个，刨去各类成本大概是……",soundOpen=1},mt),
    ["2029015"]=setmetatable({soundId=2029015,leaderId=2029001,sounType=1,soundName="索然",characterVoiceName="Vo_Sanye_Main_Idle2",soundText="哈，摸鱼也能算工资，真爽啊",soundOpen=1},mt),
