    ["2029017"]=setmetatable({soundId=2029017,leaderId=2029001,sounType=1,soundName="就餐问候",characterVoiceName="Vo_Sanye_Other_Party",soundText="吃饱饱，赚多多，这里真是最佳职场啊。",soundOpen=1},mt),
    ["2029018"]=setmetatable({soundId=2029018,leaderId=2029001,sounType=1,soundName="就餐交谈",characterVoiceName="Vo_Sanye_Other_PartyFriend",soundText="不管她的话，巢湖就只会一个劲地吃小鱼干，就算是鱼龙除了吃鱼也得吃点海藻之类的东西吧。",soundOpen=8},mt),
    ["2029019"]=setmetatable({soundId=2029019,leaderId=2029001,sounType=1,soundName="特定节日祝福",characterVoiceName="Vo_Sanye_Other_Festival",soundText="导师，新年快乐，恭喜发财，红包拿来！给瓦哈纳打工，虽然没有年终奖，但是红包总归是有的吧？",soundOpen=9},mt),
    ["2029020"]=setmetatable({soundId=2029020,leaderId=2029001,sounType=1,soundName="导师生日祝福",characterVoiceName="Vo_Sanye_Other_PlayerBirth",soundText="生日快乐，祝你年年有今日，岁岁有钞票。作为礼物，我为你准备了200页的理财计划书，导师平时也要注重理财呀。",soundOpen=10},mt),
    ["2029021"]=setmetatable({soundId=2029021,leaderId=2029001,sounType=2,soundName="入队",characterVoiceName="Vo_Sanye_Battle_JoinTeam",soundText="躲避和防御，我的生存战略",soundOpen=1},mt),
