    ["2030001"]=setmetatable({soundId=2030001,leaderId=2030001,sounType=1,soundName="白昼的问候",characterVoiceName="Vo_Zuoyide_Main_Login_Day",soundText="比起早安，我更喜欢说，又是新的一天。",soundOpen=1},mt),
    ["2030002"]=setmetatable({soundId=2030002,leaderId=2030001,sounType=1,soundName="白昼的致意",characterVoiceName="Vo_Zuoyide_Main_Login_DayUp",soundText="竟然一直睡到这个时候……（叹气），你的生活实在太混乱了。",soundOpen=1},mt),
    ["2030003"]=setmetatable({soundId=2030003,leaderId=2030001,sounType=1,soundName="夜幕的问候",characterVoiceName="Vo_Zuoyide_Main_Login_Night",soundText="夜晚很危险？不，只是我们还不够了解它。",soundOpen=1},mt),
    ["2030004"]=setmetatable({soundId=2030004,leaderId=2030001,sounType=1,soundName="夜幕的致意",characterVoiceName="Vo_Zuoyide_Main_Login_NightUp",soundText="我睡前会做什么？嗯（稍微拖长音），你为什么会好奇这件事呢？",soundOpen=1},mt),
    ["2030005"]=setmetatable({soundId=2030005,leaderId=2030001,sounType=1,soundName="久违",characterVoiceName="Vo_Zuoyide_Main_Offline",soundText="站住，还想跑？（停顿）你知道“跟踪”的意思吗？就是不管你躲在哪里，都会被我找到。",soundOpen=7},mt),
    ["2030006"]=setmetatable({soundId=2030006,leaderId=2030001,sounType=1,soundName="不期而遇",characterVoiceName="Vo_Zuoyide_Main_Special",soundText="啊，你怎么（在这里）……不，这不是我的书，我根本不知道里面写了什么。",soundOpen=1},mt),
    ["2030007"]=setmetatable({soundId=2030007,leaderId=2030001,sounType=1,soundName="交流",characterVoiceName="Vo_Zuoyide_Main_Talk1",soundText="这个？只是普通的装饰物而已，但它很漂亮，让人心情愉快。",soundOpen=1},mt),
    ["2030008"]=setmetatable({soundId=2030008,leaderId=2030001,sounType=1,soundName="答辞",characterVoiceName="Vo_Zuoyide_Main_Talk2",soundText="世界上第一块管水母化石，是我发现的，当时所有人都吓了一跳......难以置信，这些沉默的生命，能够震撼几百万年后的我们。",soundOpen=1},mt),
